const TDepth = [
    {
        "id": 1,
        "stage": "T",
        "option_stage": "X",
        "description": "Primary tumor cannot be assessed",
        "short_hand": "Can't Assess"
    },
    {
        "id": 2,
        "stage": "T",
        "option_stage": "0",
        "description": "No evidence of primary tumor",
        "short_hand": "No evidence"
    },
    {
        "id": 3,
        "stage": "T",
        "option_stage": "is",
        "description": "Melanoma in situ",
        "short_hand": "In situ"
    },
    {
        "id": 4,
        "stage": "T",
        "option_stage": "1",
        "description": "Thickness ≤ 1.0mm",
        "short_hand": "≤ 1.0mm"
    },
    {
        "id": 5,
        "stage": "T",
        "option_stage": "2",
        "description": "Thickness 1.1 - 2.0mm",
        "short_hand": "1.1 - 2.0mm"
    },
    {
        "id": 6,
        "stage": "T",
        "option_stage": "3",
        "description": "Thickness 2.0 - 4.0mm",
        "short_hand": "2.0 - 4.0mm"
    },
    {
        "id": 7,
        "stage": "T",
        "option_stage": "4",
        "description": "Thickness > 4.0 mm",
        "short_hand": "> 4.0 mm"
    },
]

export default TDepth;
